description:
Define a test method that begins by instantiating a `JexlBuilder`, then chain `safe(false)` passing the boolean literal `false`, chain `strict(true)` passing the boolean literal `true`, and finally chain `create()` to produce a `JexlEngine` instance, assigning the result to a final variable `jexl`. Invoke `createScript` on `jexl` with two arguments: the String literal `"switch(i)
    {
        case 1: i += 2;
        case 2: i += 3;
        default: i += 4;
    }
    ;
    i + 33"` (which contains a switch statement with cases 1 and 2 plus a default, followed by an expression `i + 33`) and the String literal `"i"` as the parameter name, assigning the returned `JexlScript` to a final variable `e`. Instantiate a `MapContext` with no arguments, assigning it to a final variable `jc` of type `JexlContext`. Invoke `execute` on `e` passing `jc` and the integer literal `2` as arguments, assigning the returned `Object` to a final variable `o`. Assert that `o` equals the integer literal `42` using `assertEquals(42, o)`. After the test method completes, the teardown method invokes a helper method `debuggerCheck` passing a static field `JEXL` of type `JexlEngine`; this helper internally calls `Util.debuggerCheck(ijexl)` which recreates each expression from the JexlNode in the JexlEngine cache and tests them for equality with the origin to validate the debugger. The test uses JUnit 5 assertions via `assertEquals`, no class-level annotations are present, the test method is annotated with `@Test`, and the test class is annotated with `@SuppressWarnings({ "AssertEqualsBetweenInconvertibleTypes" })`.

Define a test method that instantiates a `JexlEngine` by calling `new JexlBuilder().create()` and assigns it to variable `jexl`, then instantiates a `JexlContext` by calling `new MapContext()` and assigns it to variable `context`, followed by constructing a multi-line String literal assigned to variable `code` that concatenates `"var x = 'hello';
"` with `"function test(z) {
"` with the template string `` "`${x} ${z}`;
" `` with `"}
"` and finally with `"test('world');"` (note the exact spacing and newline characters within each fragment), then invoke `createScript` on `jexl` passing `code` as the argument and assign the returned `JexlScript` to variable `script`, immediately invoke `execute` on `script` passing `context` as the argument and assign the returned `Object` to variable `result`, and assert using `Assertions.assertEquals` that the String literal `"hello world"` equals `result`. This test uses the `@Test` annotation at the method level, relies on JUnit 5 Assertions for verification, and operates without class-level annotations, setup methods, or teardown methods.

Define a test method that instantiates a `JexlBuilder` using its no-argument constructor, then immediately chain `safe(false)` passing the boolean literal `false`, chain `strict(true)` passing the boolean literal `true`, and chain `create()` to produce a `JexlEngine` instance, assigning the result to a local variable `jexl` of type `JexlEngine`. Invoke `createScript` on `jexl` with two arguments: the first is the multi-line String literal `"var j = switch(i)
    {
        case 1 -> 2;
        case 2 -> 3;
        default -> 4;
    }
    ;
    j"` (preserving all whitespace and newlines exactly as shown), and the second is the String literal `"i"`, assigning the returned `JexlScript` to a local variable `e`. Instantiate a `MapContext` using its no-argument constructor and assign it to a local variable `jc` of type `JexlContext`. Invoke `execute` on `e` with two arguments: `jc` and the integer literal `1`, assigning the returned `Object` to a local variable `o`. Assert that `o` equals the integer value `2` using `assertEquals(2, o)`. In the teardown phase, invoke the inherited method `debuggerCheck` passing the class field `JEXL` as argument; this method internally calls `Util.debuggerCheck(ijexl)` which recreates each expression from the JexlNode in the JexlEngine cache and tests them for equality with the origin, throwing `Exception` if validation fails. The test uses `@Test` as the method-level annotation, and relies on JUnit 5 Assertions for the `assertEquals` call.

Define a test method that instantiates a `JexlFeatures` object by invoking the no-argument constructor, then immediately chain a call to `referenceCapture(true)` on it, assigning the result to a final variable named `f426` of type `JexlFeatures`. Next, instantiate a `JexlBuilder` using its no-argument constructor, chain a call to `features(f426)` passing the previously created `f426` instance, then chain a call to `create()`, and assign the resulting `JexlEngine` instance to a final variable named `jexl`. Declare a final String variable named `src` and assign it the multi-line literal value `"let z = 32;
    let x = 40;
    function foo()
    {
        x += 2;
    }
    ;
    function bar()
    {
        let x = -169;
        foo();
        x;
    }
    ;
    bar();
    "` (preserving all whitespace and newlines exactly as shown). Invoke `createScript(src)` on the `jexl` engine instance, assigning the returned `JexlScript` to a final variable named `script`. Immediately assert that `script` is not null by invoking `assertNotNull(script)`. Then invoke `execute(null)` on the `script` object, assigning the returned `Object` to a final variable named `result`. Finally, assert that `result` equals the integer value `-169` by invoking `Assertions.assertEquals(-169, result)`. The test method uses the `@Test` annotation, and the test class is annotated with `@SuppressWarnings({ "AssertEqualsBetweenInconvertibleTypes" })`. Assertions are performed using JUnit 5 Assertions (`assertNotNull` and `Assertions.assertEquals`), and no mocking libraries are present.

Define a test method that begins by instantiating a `JexlBuilder`, chaining `safe(false)` to disable safe navigation, chaining `strict(true)` to enable strict mode, then invoking `create()` to produce a `JexlEngine` instance assigned to variable `jexl`. Construct a String literal assigned to variable `src` by concatenating the following exact fragments: `"switch (x) {
"`, `" case 10 : return 3
;"`, `" case 20 : case 21 : return 4;
"`, `" case 32: break; 
"`, `" default : return x + 4;
"`, `" }
"`, and `" 169"`, forming a multi-line switch statement source code. Invoke `createScript` on `jexl` passing `src` and the String literal `"x"` as arguments, assigning the returned `JexlScript` to variable `script`. Assert that `script` is not null using `assertNotNull(script)`. Invoke `getParsedText()` on `script` to retrieve the parsed representation, assigning the result to variable `dbgStr`, then assert that `dbgStr` is not null using `assertNotNull(dbgStr)`. Execute the script by invoking `execute` on `script` with arguments `null` and integer `10`, assigning the result to variable `result`, and immediately assert using `Assertions.assertEquals(3, result)` that the result equals integer `3`. Reassign `result` by invoking `execute` on `script` with arguments `null` and integer `20`, then assert using `Assertions.assertEquals(4, result)` that the result equals integer `4`. Reassign `result` by invoking `execute` on `script` with arguments `null` and integer `21`, then assert using `Assertions.assertEquals(4, result)` that the result equals integer `4`. Reassign `result` by invoking `execute` on `script` with arguments `null` and integer `32`, then assert using `Assertions.assertEquals(169, result)` that the result equals integer `169`. Reassign `result` by invoking `execute` on `script` with arguments `null` and integer `38`, then assert using `Assertions.assertEquals(42, result)` that the result equals integer `42`. Upon completion of the test method, the teardown method invokes a helper that performs debugger validation by calling `Util.debuggerCheck` with the class-level constant `JEXL`, which recreates each expression from the engine's cache and tests them for equality with the original; since this test does not use the class-level `JEXL` constant but instead uses the locally created `jexl` instance, define a private method that accepts a `JexlEngine` parameter, invokes `Util.debuggerCheck` passing that engine, and call this method from the teardown passing the appropriate engine reference if needed, though in this specific test the teardown references `JEXL` which is not the local `jexl` variable. The test uses method-level annotation `@Test`, assertion library JUnit 5 Assertions (via `Assertions.assertEquals`) and standard JUnit assertions (`assertNotNull`), and no mocking libraries.

Define a test method that instantiates a `JexlEngine` by constructing a `JexlBuilder`, chaining `loader(getClass().getClassLoader())` where `getClass()` returns the test class's `Class<?>` object and `getClassLoader()` retrieves its `ClassLoader`, then chaining `imports(this.getClass().getName())` where `this.getClass().getName()` returns the fully qualified name of the test class as a `String`, and finally invoking `create()` to produce the engine, assigning the result to variable `jexl`. Assign to variable `src` the `String` literal `"let s = switch (x)
    {
        case Scope440.UNDEFINED -> 'undefined';
    }
    s"`. Invoke `createScript` on `jexl` with arguments `src` and the `String` literal `"x"`, assigning the returned `JexlScript` to variable `script`. Within a try-catch block, invoke `execute` on `script` with arguments `null` and the enum constant `Scope440.THIS`, then immediately invoke `fail` with the `String` message `"should not be able to execute script with switch expression with no default"` to signal that execution should not have succeeded. In the catch block for `JexlException` assigned to variable `xjexl`, invoke `assertTrue` with the result of calling `contains("switch")` on the `String` returned by `getMessage()` invoked on `xjexl`, verifying that the exception message contains the substring `"switch"`. After the test method completes, the teardown method invokes a helper that performs debugger validation by calling `Util.debuggerCheck` with the static field `JEXL` from the test class, which recreates each expression from the engine cache and tests them for equality with the origin. Class-level annotations: `@SuppressWarnings({ "AssertEqualsBetweenInconvertibleTypes" })`. Method-level annotations: `@Test`. Assertion library: JUnit (via `fail` and `assertTrue`). No mocking libraries are used.

Begin by instantiating a `JexlBuilder` using its no-argument constructor, then chain `loader` passing the result of `getClass().getClassLoader()` where `getClass()` returns the test class's `Class<?>` object, chain `imports` passing the result of `this.getClass().getName()` which retrieves the fully qualified name of the test class as a `String`, and finally chain `create()` to produce a `JexlEngine` instance, assigning it to a final variable `jexl`. Define a final `String` variable `src` containing the exact multi-line literal `"let s = switch (x)
    {
        case Scope440.UNDEFINED -> 'undefined';
        case Scope440.THIS -> 'this';
        default -> 'OTHER';
    }
    s"` (preserving all whitespace and line breaks). Invoke `createScript` on `jexl` passing `src` and the `String` literal `"x"` as arguments, assigning the returned `JexlScript` to a final variable `script`. Assert that `script` is not null using `assertNotNull(script)`. Invoke `getParsedText()` on `script` with no arguments, assigning the returned `String` to a variable `dbgStr`, then assert that `dbgStr` is not null using `assertNotNull(dbgStr)`. Invoke `execute` on `script` passing `null` as the first argument and the enum constant `Scope440.UNDEFINED` as the second argument, assigning the returned `Object` to a variable `result`, and immediately assert using `Assertions.assertEquals("undefined", result)` that the result equals the `String` literal `"undefined"`. Reassign `result` by invoking `execute` on `script` again with `null` and the enum constant `Scope440.THIS`, then assert using `Assertions.assertEquals("this", result)` that the result equals the `String` literal `"this"`. Reassign `result` once more by invoking `execute` on `script` with `null` and the `int` literal `21`, then assert using `Assertions.assertEquals("OTHER", result)` that the result equals the `String` literal `"OTHER"`. For teardown, define a private method that invokes `debuggerCheck` on the class `Util` (from `org.apache.commons.jexl3.internal.Util`) passing the `JexlEngine` instance `JEXL` as an argument, and invoke this teardown method after the test completes. The test uses method-level annotation `@Test`, class-level annotation `@SuppressWarnings({ "AssertEqualsBetweenInconvertibleTypes" })`, assertion libraries JUnit 5 Assertions (for `assertEquals`) and standard JUnit assertions (for `assertNotNull`), and no mocking libraries.

Define a test method that begins by instantiating a `JexlEngine` by calling `new JexlBuilder().create()` and assigning the result to variable `jexl`, then declare a `String` variable `src` containing the exact literal value `"const c = `${a}
?= ${b}`; function foo(const left, const right) { `${left}
?== ${right}` } c+foo(a, b)"`, invoke `createScript` on `jexl` passing `src` and a `String` array containing `"a"` and `"b"` as parameter names, assigning the returned `JexlScript` to variable `script`, immediately invoke `execute` on `script` with arguments `null` and a `String` array containing `"a"` and `"b"`, assigning the result to `Object` variable `result`, assert using `Assertions.assertEquals` that `result` equals the exact `String` literal `"a
?= ba
?== b"`, then invoke `getLocalVariables()` on `script` and assign the returned `String[]` to variable `locals`, assert using `Assertions.assertArrayEquals` that `locals` equals a new `String` array containing exactly `"c"` and `"foo"` in that order, declare a `String` variable `TEST447` initialized to the literal `"src/test/scripts/test447.jexl"`, construct a `File` instance by calling `new File(TEST447)` and assign it to variable `src447`, invoke `createScript` on `jexl` passing `src447` as the sole argument and assign the returned `JexlScript` to variable `script447`, invoke `execute` on `script447` with argument `null` and assign the result to `Object` variable `result447`, assert using `Assertions.assertInstanceOf` that `result447` is an instance of `List.class`, cast `result447` to `List<Boolean>` with a `@SuppressWarnings("unchecked")` annotation and assign it to variable `list`, iterate over `list` using an enhanced for-loop with loop variable `item` of type `Boolean`, and within each iteration assert using `Assertions.assertTrue` that `item` is true, using JUnit 5 Assertions throughout and annotating the test method with `@Test`.

Instantiate a `JexlEngine` by constructing a new `JexlBuilder`, chaining `loader` with the result of invoking `getClassLoader()` on the `Class` object returned by `getClass()`, then chaining `imports` with the result of invoking `getName()` on the `Class` object returned by `this.getClass()`, and finally invoking `create()`, assigning the result to variable `jexl`. Assign to variable `src` the String literal `"function f(x)
    {
        switch (x)
        {
            case Scope440.UNDEFINED : return 'undefined';
        }
    }
    f(x)"`. Invoke `createScript` on `jexl` passing `src` and String literal `"x"` as arguments, assigning the result to variable `script`. Invoke `execute` on `script` passing `null` and the static field `Scope440.UNDEFINED` as arguments, assigning the result to variable `result`. Assert that `result` equals String literal `"undefined"` using `Assertions.assertEquals`. Within a try-catch block catching `JexlException` and assigning it to variable `xjexl`, invoke `execute` on `script` passing `null` and the static field `Scope440.THIS` as arguments, then immediately invoke `fail` with String literal `"should not be able to execute script with switch expression with no default"` to signal that the expected exception was not thrown. In the catch block, invoke `getMessage()` on `xjexl`, then invoke `contains` on the returned String with argument `"switch"`, and assert the result is true using `assertTrue`. After test execution, define a teardown method that invokes `debuggerCheck` passing the static field `JEXL` as argument, where `debuggerCheck` internally calls `Util.debuggerCheck` with the same engine argument. Class-level annotations: none. Method-level annotations: `@Test`. Assertion libraries: JUnit 5 Assertions. Mocking libraries: none.

Define a test method that begins by instantiating a `JexlFeatures` object using the no-argument constructor, then immediately chain a call to `referenceCapture` passing boolean literal `true`, assigning the result to final variable `f426` of type `JexlFeatures`. Next, instantiate a `JexlBuilder` using the no-argument constructor, chain a call to `features` passing `f426`, then chain `create()`, assigning the final result to variable `jexl` of type `JexlEngine`. Assign to variable `src` of type `String` the multi-line literal `"let x = 40;
    function foo()
    {
        x += 2;
    }
    ;
    function bar()
    {
        x = -169;
        () ->
        {
            foo();
        }
    }
    ;
    bar();
    "`. Invoke `createScript` on `jexl` passing `src` as the sole argument, assigning the returned value to variable `script` of type `JexlScript`. Assert that `script` is not null using `assertNotNull`. Invoke `execute` on `script` passing `null` as the argument, assigning the returned `Object` to variable `result`. Assert that `result` is an instance of `JexlScript.class` using `assertInstanceOf` with arguments `JexlScript.class` and `result`. Reassign `script` by invoking `createScript` on `jexl` with two arguments: String literal `"f()"` and String literal `"f"`. Reassign `result` by invoking `execute` on the newly assigned `script` with two arguments: `null` and the previous `result` value. Assert equality using `Assertions.assertEquals` with expected value integer `-167` and actual value `result`. Upon test completion, define a private method that invokes `debuggerCheck` on class `Util` (from `org.apache.commons.jexl3.internal.Util`) passing a `JexlEngine` argument, then invoke this private method from a teardown method annotated with `@AfterEach`, passing a class-level constant `JEXL` of type `JexlEngine` as the argument. The test uses class-level annotation `@SuppressWarnings({"AssertEqualsBetweenInconvertibleTypes"})`, method-level annotation `@Test`, assertion libraries JUnit 5 Assertions and standard JUnit assertions, and no mocking libraries.

Define a test class containing seven static final fields: `DATA` of type `String`, `EMPTY_MAP` of type `Map<String, Boolean>`, `CURRENT_PATH` of type `Path`, `ABSENT_PATH` of type `Path`, `DOC_DIR` of type `String`, `DOC_RELATIVE` of type `String`, and `DOC_ROOT` of type `String`, where the initialization values for these fields are determined by the test suite context but are not directly used in this specific test method. Write a test method annotated with `@Test` that begins by invoking the static method `createInterpolator()` on class `StringSubstitutor`, assigning the returned `StringSubstitutor` instance to a local variable named `stringSubstitutor`. Immediately following this assignment, invoke `assertThrows` with two arguments: the first argument is the class literal `IllegalArgumentException.class`, and the second argument is a lambda expression that invokes the `replace` method on `stringSubstitutor` with a single `String` argument constructed by concatenating the literal `"${"` (with embedded newline and whitespace as `"$
    {
        xml:"`) followed by the value of the static field `DOC_DIR`, followed by the literal `"bla.xml:/document/content
    }
    "` (preserving the exact whitespace and newline structure), thereby verifying that an `IllegalArgumentException` is thrown when attempting to perform XML lookup on a non-existent file path. The test uses the JUnit 5 Assertions library for `assertThrows` and operates without class-level annotations, method-level annotations include `@Test`, and no mocking libraries are present.

Begin by defining a test method annotated with `@Test` that validates the behavior of `ArrayUtils.toString(Object, String)` when invoked with various input combinations. Invoke `assertEquals` with expected value `"<empty>"` and actual value obtained by calling `ArrayUtils.toString(null, "<empty>")`, verifying that a null array input returns the default string literal `"<empty>"`. Next, invoke `assertEquals` with expected value `"
{
}
"` (a multiline string containing opening brace, newline, closing brace, newline) and actual value from `ArrayUtils.toString(new Object[0], "<empty>")`, confirming that an empty `Object` array produces the formatted empty braces output. Then invoke `assertEquals` with the same expected value `"
{
}
"` and actual value from `ArrayUtils.toString(new String[0], "<empty>")`, verifying that an empty `String` array also produces the formatted empty braces. Following this, invoke `assertEquals` with expected value `"
{
    <null>
}
"` (multiline string with indented `<null>` placeholder) and actual value from `ArrayUtils.toString(new String[]{null}, "<empty>")`, confirming that a single-element `String` array containing `null` renders the null placeholder within formatted braces. Finally, invoke `assertEquals` with expected value `"
{
    pink,blue
}
"` (multiline string with indented comma-separated values) and actual value from `ArrayUtils.toString(new String[]{"pink", "blue"}, "<empty>")`, verifying that a two-element `String` array containing literal values `"pink"` and `"blue"` produces the formatted output with those values comma-separated and indented. After all test assertions complete, define a teardown method that invokes `assertTrue` with the result of `ToStringStyle.getRegistry().isEmpty()` and the failure message `"Expected null, actual: " + ToStringStyle.getRegistry()`, ensuring the `ToStringStyle` registry is empty after test execution. The test uses class-level annotation `@SuppressWarnings("deprecation")`, method-level annotation `@Test`, assertion library JUnit 5 Assertions, and no mocking libraries.

Define a test class containing a static final `char[]` field named `EQ_FRIEND`, then write a test method annotated with `@Test` that begins by instantiating a `JexlEngine` named `jexl` via `new JexlBuilder().create()`, immediately followed by asserting equality between the String literal `"42"` and the result of invoking `createScript` on `jexl` with arguments `"o.toString()"` and `"o"`, then chaining `execute` with arguments `null` and `"42"` on the returned script. Next, create a `JexlPermissions` instance named `perms` by invoking `compose` on the static field `RESTRICTED` with the String argument `"java.lang
{
    +Class
    {
        getSimpleName();
    }
}
"`, then instantiate a `JexlSandbox` named `sandbox` using the constructor with boolean arguments `false` and `true`. Invoke `permissions` on `sandbox` passing `Object.class.getName()` as the first argument followed by boolean values `true`, `true`, `false`, `false`, then chain `allow` on `sandbox` passing `String.class.getName()` and chain `execute` with the String literal `"toString"` on the returned permissions object. Construct a final `JexlEngine` named `jexl451` by chaining `safe(false)`, `silent(false)`, `permissions(perms)`, and `sandbox(sandbox)` on a new `JexlBuilder()` instance before calling `create()`. Assert equality between `"42"` and the result of invoking `createScript` on `jexl451` with arguments `"o.toString()"` and `"o"`, then chaining `execute` with arguments `null` and `"42"`. Use `assertThrows` expecting `JexlException.Method.class` when executing a lambda that invokes `createScript` on `jexl451` with arguments `"oo.getClass()"` and `"oo"`, then chains `execute` with arguments `null` and `"42"`. Assert equality between `String.class` and the result of invoking `createScript` on `jexl451` with arguments `"o.class"` and `"o"`, then chaining `execute` with arguments `null` and `"42"`. Assert equality between the String literal `"Object"` and the result of invoking `createScript` on `jexl451` with arguments `"o.class.simpleName"` and `"o"`, then chaining `execute` with arguments `null` and a new `Object()` instance. Finally, use `assertThrows` expecting `JexlException.Property.class` when executing a lambda that invokes `createScript` on `jexl451` with arguments `"o.class.classLoader"` and `"o"`, then chains `execute` with arguments `null` and a new `Object()` instance. This test uses JUnit 5 Assertions with method-level annotation `@Test` and no class-level annotations.

Define a test method annotated with `@Test` that validates the behavior of `StringUtils.abbreviate` with four parameters (String, String, int, int) by executing a series of assertions in sequence: invoke `assertNull` on the result of `StringUtils.abbreviate(null, null, 10, 12)`, then invoke `assertNull` on `StringUtils.abbreviate(null, "...", 10, 12)`, then invoke `assertEquals` with expected value `""` and actual value from `StringUtils.abbreviate("", null, 0, 10)`, then invoke `assertEquals` with expected value `""` and actual value from `StringUtils.abbreviate("", "...", 2, 10)`, then define a private method that accepts four parameters (String `expected`, String `abbrevMarker`, int `offset`, int `maxWidth`) which declares a String variable `abcdefghijklmno` initialized to `"abcdefghijklmno"`, declares a String variable `message` initialized to `"abbreviate(String,String,int,int) failed"`, declares a String variable `actual` initialized by invoking `StringUtils.abbreviate(abcdefghijklmno, abbrevMarker, offset, maxWidth)`, conditionally invokes `assertTrue` with the expression `actual.indexOf((char) ('a' + offset)) != -1` and the message `message + " -- should contain offset character"` if `offset >= 0 && offset < abcdefghijklmno.length()` evaluates to true, invokes `assertTrue` with a lambda supplier `() -> message + " -- should not be greater than maxWidth"` and the condition `actual.length() <= maxWidth`, and finally invokes `assertEquals(expected, actual, message)`, then invoke this private method with arguments `"abcdefgh;
    ;
    "`, `";
    ;
    "`, `-1`, `10`, then invoke it with `"abcdefghi."`, `"."`, `0`, `10`, then invoke it with `"abcdefgh++"`, `"++"`, `1`, `10`, then invoke it with `"abcdefghi*"`, `"*"`, `2`, `10`, then invoke it with `"abcdef
    {
        {
            {
                {
                    "`, `"
                    {
                        {
                            {
                                {
                                    "`, `4`, `10`, then invoke it with `"abcdef____"`, `"____"`, `5`, `10`, then invoke it with `"==fghijk=="`, `"=="`, `5`, `10`, then invoke it with `"___ghij___"`, `"___"`, `6`, `10`, then invoke it with `"/ghijklmno"`, `"/"`, `7`, `10`, then invoke it with `"/ghijklmno"`, `"/"`, `8`, `10`, then invoke it with `"/ghijklmno"`, `"/"`, `9`, `10`, then invoke it with `"///ijklmno"`, `"///"`, `10`, `10`, then invoke it with `"//hijklmno"`, `"//"`, `10`, `10`, then invoke it with `"//hijklmno"`, `"//"`, `11`, `10`, then invoke it with `"...ijklmno"`, `"..."`, `12`, `10`, then invoke it with `"/ghijklmno"`, `"/"`, `13`, `10`, then invoke it with `"/ghijklmno"`, `"/"`, `14`, `10`, then invoke it with `"999ijklmno"`, `"999"`, `15`, `10`, then invoke it with `"_ghijklmno"`, `"_"`, `16`, `10`, then invoke it with `"+ghijklmno"`, `"+"`, `Integer.MAX_VALUE`, `10`, then invoke a method named `assertIllegalArgumentException` passing a lambda `() -> StringUtils.abbreviate("abcdefghij", "::", 0, 2)` and the message `"StringUtils.abbreviate expecting IllegalArgumentException"`, then invoke `assertIllegalArgumentException` passing a lambda `() -> StringUtils.abbreviate("abcdefghij", "!!!", 5, 6)` and the message `"StringUtils.abbreviate expecting IllegalArgumentException"`, then declare a String variable `raspberry` initialized to `"raspberry peach"`, then invoke `assertEquals` with expected value `"raspberry peach"` and actual value from `StringUtils.abbreviate(raspberry, "--", 12, 15)`, and finally invoke `assertNull` on the result of `StringUtils.abbreviate(null, ";
    ", 7, 14)`. The test uses method-level annotation `@Test` and assertion libraries JUnit 5 Assertions.

Define a test class containing seven static final fields: `DATA` of type `String`, `EMPTY_MAP` of type `Map<String, Boolean>`, `CURRENT_PATH` of type `Path`, `ABSENT_PATH` of type `Path`, `DOC_DIR` of type `String`, `DOC_RELATIVE` of type `String`, and `DOC_ROOT` of type `String`, initializing them with appropriate values as needed for the test context. Write a test method annotated with `@Test` that begins by invoking the static method `createInterpolator()` on class `StringSubstitutor`, assigning the returned `StringSubstitutor` instance to a local variable named `stringSubstitutor`. Immediately invoke `assertThrows` from the assertion library, passing `IllegalArgumentException.class` as the first argument and a lambda expression as the second argument, where the lambda body calls `replace` on `stringSubstitutor` with a single `String` argument constructed by concatenating the literal `"${"` (with newline and whitespace formatting as `"$
    {
        xml:"`), followed by the value of the static field `DOC_DIR`, followed by the literal `"document-external-dtd.xml:/document/content
    }
    "` (preserving the exact whitespace and newline structure), thereby verifying that invoking `replace` with this XML variable reference string throws an `IllegalArgumentException` when external DTD processing is disabled. The test uses JUnit 5 Assertions with the `assertThrows` method and operates on the `StringSubstitutor` class from Apache Commons Text, specifically testing the interpolator's behavior when attempting to resolve an XML lookup with an external DTD reference.
